import { register_ok } from "../images/register_ok.svg";

function InfoTooltip() {
  const textRegisterOk = "Вы успешно зарегистрировались!"
  const textRegisterBad = "Что-то пошло не так! Попробуйте ещё раз."

  return (
    <div className="info-tooltip">
      <div className={"info-tooltip__container"}>
        <img className="" alt="значок статуса регистрации" src={register_ok} />
        <p className={"popup__title"}>{textRegisterOk}</p>
      </div>
    </div>
  );
}

export default InfoTooltip;
